'use strict';

// MODULES //

var dtypes = require( './dtypes.json' );


// MAIN //

/**
* Returns a constructor cache.
*
* @private
* @returns {Object} constructor cache
*/
function cache() {
	var out;
	var i;

	out = {};
	for ( i = 0; i < dtypes.length; i++ ) {
		out[ dtypes[ i ] ] = [];
	}
	return out;
} // end FUNCTION cache()


// EXPORTS //

module.exports = cache;
